// Query syntax converter
const QueryConverter = {

    // Query ::= From Let* Where? Select? Order? Limit? ;
    "Query": function(tree) {
        // FROM
        const query = { "from": tree.children[0].value };
        let index = 1;

        // LET
        query.lets = [];
        while (index < tree.children.length && tree.children[index].label == "Let") {
            query.lets.push(tree.children[index].value);
            index++;
        }

        // WHERE
        if (index < tree.children.length && tree.children[index].label == "Where") {
            query.where = tree.children[index].value;
            index++;
        } else {
            query.where = new SyntaxWhere();
        }

        // SELECT
        if (index < tree.children.length && tree.children[index].label == "Select") {
            query.select = tree.children[index].value;
            index++;
        } else {
            query.select = new SyntaxSelect();
        }

        // ORDER BY
        if (index < tree.children.length && tree.children[index].label == "Order") {
            query.order = tree.children[index].value;
            index++;
        } else {
            query.order = new SyntaxOrder();
        }

        // LIMIT
        if (index < tree.children.length && tree.children[index].label == "Limit") {
            query.limit = tree.children[index].value;
            index++;
        } else {
            query.limit = new SyntaxLiteral(0);
        }
        tree.value = query;
    },

    // From ::= 'FROM' String ;
    "From": function(tree) {
        tree.value = tree.children[1].value;
    },

    // String ::= """(\\""|[^""])*""" ;
    "String": function(tree) {
        const text = tree.children[0].text.replace("\\\"", "\"");
        tree.value = text.substring(1, text.length - 1);
    },

    // Let ::= 'LET' User '=' Term ;
    "Let": function(tree) {
        tree.value = { "name": tree.children[1].value, "term": tree.children[3].value };
    },

    // Where ::= 'WHERE' Condition ;
    "Where": function(tree) {
        const where = new SyntaxWhere();
        where.condition = tree.children[1].value;
        tree.value = where;
    },

    // Condition ::= Part ('OR' Part)* ;
    "Condition": function(tree) {
        const condition = new SyntaxCondition();
        for (let i = 0; i < tree.children.length; i += 2) {
            condition.list.push(tree.children[i].value);
        }
        tree.value = condition;
    },

    // Part ::= Unit ('AND' Unit)* ;
    "Part": function(tree) {
        const part = new SyntaxPart();
        for (let i = 0; i < tree.children.length; i += 2) {
            part.list.push(tree.children[i].value);
        }
        tree.value = part;
    },

    // Unit ::= 'NOT'? Expression ;
    "Unit": function(tree) {
        const unit = new SyntaxUnit();
        if (1 < tree.children.length) {
            // with NOT
            unit.not = true;
            unit.expression = tree.children[1].value;
        } else {
            // without NOT
            unit.expression = tree.children[0].value;
        }
        tree.value = unit;
    },

    // Expression ::= Term (Compare Term | Clause)? ;
    "Expression": function(tree) {
        const expression = new SyntaxExpression(tree.children[0].value);
        if (tree.children.length == 3) {
            // Term Compare Term
            expression.compare = tree.children[1].value;
            expression.second = tree.children[2].value;
        } else if (tree.children.length == 2) {
            // Term Clause
            expression.clause = tree.children[1].value;
        }
        tree.value = expression;
    },

    // Term ::= Factor (('+' | '-' | '&') Factor)* ;
    "Term": function(tree) {
        const term = new SyntaxTerm(tree.children[0].value);
        for (let i = 2; i < tree.children.length; i += 2) {
            term.add(tree.children[i - 1].text, tree.children[i].value);
        }
        tree.value = term;
    },

    // Factor ::= Value (('*' | '/' | '%') Value)* ;
    "Factor": function(tree) {
        const factor = new SyntaxFactor(tree.children[0].value);
        for (let i = 2; i < tree.children.length; i += 2) {
            factor.add(tree.children[i - 1].text, tree.children[i].value);
        }
        tree.value = factor;
    },

    // Value ::= Element ('.' (Property | Method | Iterator))* ;
    "Value": function(tree) {
        const value = new SyntaxValue(tree.children[0].value);
        for (let i = 2; i < tree.children.length; i += 2) {
            value.follows.push(tree.children[i].value);
        }
        tree.value = value;
    },

    // Element ::= Auto | User | Literal | '(' Condition ')' ;
    "Element": function(tree) {
        if (tree.children.length == 1) {
            const child = tree.children[0];
            switch (child.label) {
                case "Auto":
                    // Auto
                    tree.value = new SyntaxAuto(child.value);
                    break;

                case "User":
                    // User
                    tree.value = new SyntaxUser(child.value);
                    break;

                default:
                    // Literal
                    tree.value = new SyntaxLiteral(child.value);
                    break;
            }
        } else {
            // '(' Condition ')'
            tree.value = tree.children[1].value;
        }
    },

    // Auto ::= "\$[0-9]*" ;
    "Auto": function(tree) {
        const text = tree.children[0].text.substring(1);
        if (0 < text.length) {
            // with variable number
            tree.value = parseInt(text, 10);
        } else {
            // without variable number
            tree.value = 0;
        }
    },

    // User ::= "\$[a-z_][a-z_0-9]*" ;
    "User": function(tree) {
        tree.value = tree.children[0].text.substring(1);
    },

    // Literal ::= String | Integer ;
    "Literal": function(tree) {
        tree.value = tree.children[0].value;
    },

    // Integer ::= "[0-9]+" ;
    "Integer": function(tree) {
        tree.value = tree.children[0].text;
    },

    // Property ::= 'pattern' | 'length' | 'reverse' | 'min' | 'max' | 'omission' | 'standard' | 'jugglable' | 'valid' | 'balls' | 'period' | 'state' | 'int10' | 'int36' ;
    "Property": function(tree) {
        tree.value = new SyntaxProperty(tree.children[0].text);
    },

    // Method ::= ('at' | 'rotate' | 'skip' | 'take') '(' Parameter ')' ;
    "Method": function(tree) {
        tree.value = new SyntaxMethod(tree.children[0].text, tree.children[2].value);
    },

    // Parameter ::= Term | '-' Value ;
    "Parameter": function(tree) {
        const param = new SyntaxParameter();
        if (1 < tree.children.length) {
            // with minus
            param.value = tree.children[1].value;
        } else {
            // without minus
            param.term = tree.children[0].value;
        }
        tree.value = param;
    },

    // Iterator ::= ('every' | 'some') '(' Lambda ')' ;
    "Iterator": function(tree) {
        tree.value = new SyntaxIterator(tree.children[0].text, tree.children[2].value);
    },

    // Lambda ::= User (',' User)? '=>' Condition ;
    "Lambda": function(tree) {
        const lambda = new SyntaxLambda(tree.children[0].value);
        if (4 < tree.children.length) {
            // with whole variable
            lambda.whole = tree.children[2].value;
            lambda.condition = tree.children[4].value;
        } else {
            // without whole variable
            lambda.condition = tree.children[2].value;
        }
        tree.value = lambda;
    },

    // Compare ::= '==' | '!=' | '<>' | '<' | '<=' | '>' | '>=' ;
    "Compare": function(tree) {
        tree.value = tree.children[0].text;
    },

    // Clause ::= 'NOT'? 'IN' '(' List ')' ;
    "Clause": function(tree) {
        const clause = { "not": false , "list": [] };
        if (4 < tree.children.length) {
            // with NOT
            clause.not = true;
            Array.prototype.push.apply(clause.list, tree.children[3].list);
        } else {
            // without NOT
            Array.prototype.push.apply(clause.list, tree.children[2].list);
        }
        tree.value = clause;
    },

    // List ::= Literal (',' Literal)* ;
    "List": function(tree) {
        tree.list = [];
        for (let i = 0; i < tree.children.length; i += 2) {
            tree.list.push(tree.children[i].value);
        }
    },

    // Select ::= 'SELECT' 'DISTINCT'? View ;
    "Select": function(tree) {
        const select = new SyntaxSelect();
        if (2 < tree.children.length) {
            // with DISTINCT
            select.distinct = true;
            Array.prototype.push.apply(select.list, tree.children[2].list);
        } else {
            // without DISTINCT
            Array.prototype.push.apply(select.list, tree.children[1].list);
        }
        tree.value = select;
    },

    // View ::= Term+ ;
    "View": function(tree) {
        tree.list = [];
        for (const child of tree.children) {
            tree.list.push(child.value);
        }
    },

    // Order ::= 'ORDER' 'BY' Multiple ;
    "Order": function(tree) {
        const order = new SyntaxOrder();
        Array.prototype.push.apply(order.list, tree.children[2].list);
        tree.value = order;
    },

    // Multiple ::= Single (',' Single)* ;
    "Multiple": function(tree) {
        tree.list = [];
        for (let i = 0; i < tree.children.length; i += 2) {
            tree.list.push(tree.children[i].value);
        }
    },

    // Single ::= Value ('ASC' | 'DESC')? ;
    "Single": function(tree) {
        const single = { "value": tree.children[0].value, "desc": false };
        if (1 < tree.children.length && tree.children[1].label == "'DESC'") {
            single.desc = true;
        }
        tree.value = single;
    },

    // Limit ::= 'LIMIT' Term ;
    "Limit": function(tree) {
        tree.value = tree.children[1].value;
    },

}

